      SELECT DISTINCT 91 * col2 * - 92 / - + col1 * - - col1 * col0 * + 4 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN col0 AND + col0 - - - col2;
  - name: tab2

outputs:
  - name: q11056.out
    data: |
